import React from "react";

const UserList = (props) => {

    return ( 
        <div>
            <h2>READ USERS</h2>
            <select className="users-list" onChange={this.change}>
                {props.users.map((item) => (
                    <option key={item.name} onClick={props.UpdateCurrentUser.bind(this,item)}>
                        {item.name}
                    </option>
                ))}
            </select>
        </div>
    );
}

export default UserList;
